Microsoft SharePoint 2010 Administrators Companion

Get the critical, in-depth information you need to administer SharePoint 2010. Led by SharePoint MVPs and featuring insights from the SharePoint community and members of the SharePoint Team at Microsoft, youll discover how to plan, design, deploy, and manage strategic solutions using SharePoint 2010, Microsoft SQL Server, Windows PowerShell, and other key technologies. Topics include architecture, deployment scenarios, design considerations, security best practices, high availability, performance, centralized administration, disaster recovery, customization, solution development, and upgrade and migration strategies. Key solutions include building and managing a server farm, automating tasks, FAST search application management, enterprise and web content management, and business intelligence.

